webpackJsonp([0x96acb37218ed5000],{"./node_modules/json-loader/index.js!./.cache/json/python-truth-value-testing.json":function(e,o){e.exports={data:{markdownRemark:{html:"<p><a href='https://docs.python.org/3/library/stdtypes.html#truth-value-testing' target='_blank' rel='nofollow'>Python Docs - Truth Value Testing</a></p>\n<p>Any object can be tested for truth value, for use in an if or while condition or as operand of the Boolean operations below. The following values are considered false:</p>\n<ul>\n<li><code>None</code></li>\n<li><code>False</code></li>\n<li>zero of any numeric type, for example, <code>0</code>, <code>0.0</code>, <code>0j</code>.</li>\n<li>any empty sequence, for example, <code>''</code>, <code>()</code>, <code>&#x3C;a href='https://docs.python.org/3/library/stdtypes.html#id11' target='_blank' rel='nofollow'>]</code>.</li>\n<li>any empty mapping, for example, <code>{}</code>.</li>\n<li>instances of user-defined classes, if the class defines a <code>__bool__()</code> or <code>__len__()</code> method, when that method returns the integer zero or <code>bool</code> value <code>False</code>. [<code>[1]</code></a></li>\n</ul>\n<p>All other values are considered true â€” so objects of many types are always true.</p>\n<p>Operations and built-in functions that have a Boolean result always return 0 or False for false and 1 or True for true, unless otherwise stated. (Important exception: the Boolean operations or and and always return one of their operands.)</p>",fields:{slug:"/python/truth-value-testing/"},frontmatter:{title:"Python Truth Value Testing"}}},pathContext:{slug:"/python/truth-value-testing/"}}}});
